import React from 'react'
import ShowVideo from '..ShowVideo/ShowVideo'

function ShowVideoGrid({ vids }) {
  return (
    <div className='container_showVideoGrid'>
      {
        vids?.map((vi) =>
        (
          <div key={vi._id} className="video_box">
            <ShowVideo vid={vi} />
          </div>


        )
        )}

    </div>
  );
}

export default ShowVideoGrid;
